import { IMAGE_ERROR, IMAGE_LOADING, IMAGE_SUCCESS } from "../../constants";


export const loadImages = () => ({
    type: IMAGE_LOADING
});

export const setImages = (images) => ({
    type: IMAGE_SUCCESS,
    images: images,
});

export const setError = (error) => ({
    type: IMAGE_ERROR,
    error: error,
});
